AppStoreInterstitial.hide = function() {
	if (!this.container.visible) return;
	
	console.log("ASI hide()");
	
	// Hide everything explicitly
    this.overlay.visible = false;
    this.container.visible = false;
    this.exitButton.visible = false;
	
    /*this.titleText.visible = false;   //JAB
    this.usp1Coin.visible = false;
    this.usp1Text.visible = false;
    this.usp2Coin.visible = false;
    this.usp2Text.visible = false;
    this.footerText.visible = false;
    this.phone.visible = false;*/

	// Force redraw and focus reset
    Game.UI.shouldReDraw = true;
	
	//console.log("HIDE INFO: Modal completely hidden.");

	if (CrossyUI.CurrentScreen === 'selectingCharacter') {
		Carousel.UpsellClosed();
		KeyboardUIControls.setFocus(Carousel.showUpsell);
	}

	if (CrossyUI.CurrentScreen === 'main') {
		logo.style.display = 'block';
		KeyboardUIControls.setFocus(moveToPlay);

		showUpsell.x = 10;
		showUpsell.anchor.x = ThreeUI.anchors.right;

		CrossyUI.ButtonScaleSet();

	} else if (CrossyUI.CurrentScreen === 'death') {
		KeyboardUIControls.setFocus(playButton);
	}
	
	
	//console.log("phone visible:",this.phone.visible);
};

