AppStoreInterstitial.superComplicatedResize = function() {
	if (!this.container.visible) return;

	// Determine container dimensions

	var aspectRatio = Game.canvas.width / Game.canvas.height;
	var percLandscape = CrossyUtils.inverseLerp(window.minAspect, window.maxAspect, aspectRatio);
	var percPortrait = 1 - percLandscape;
	var minSideMargin = 20;
	var maxSideMargin = 250;
	var maxWidthBreakpoint = 0.5; // percLandscape
	var maxHeightBreakpoint = 0.8; // percPortrait
	var minHeightMargin = 50;
	var maxHeightMargin = 250;
	var bottomBuffer = 70;
	var textScaleDownBreakpoint = 0.4; // percLandscape
	var upsellScaleDownBreakpoint = 0.5; // percLandscape

	this.container.stretch.x = true;
	this.container.stretch.y = true;

	var percLandscapeForWidth = Math.max((percLandscape - maxWidthBreakpoint) * (1 / maxWidthBreakpoint), 0);
	var sideMargin = THREE.Math.lerp(minSideMargin, maxSideMargin, percLandscapeForWidth);

	this.container.offset.left = sideMargin;
	this.container.offset.right = sideMargin;

	var percPortraitForHeight = Math.max((percPortrait - maxHeightBreakpoint) * (1 / maxHeightBreakpoint), 0);
	var heightMargin = THREE.Math.lerp(minHeightMargin, maxHeightMargin, percPortraitForHeight);

	this.container.offset.bottom = heightMargin + bottomBuffer;
	this.container.offset.top = heightMargin;

	var containerSize = this.container.determineDimensionsInCanvas();
	var containerRatio = containerSize.width / containerSize.height;
	var upsellButtonsBelowEachOtherBreakPoint = 1.1; // containerRatio

	// Adjust scaling according to container dimensions

	var percLandscapeForTextScale = Math.max(0, Math.min(1, CrossyUtils.inverseLerp(0, textScaleDownBreakpoint, percLandscape)));
	var textScale = THREE.Math.lerp(0.5, 1, percLandscapeForTextScale);

	this.padding = 25 * textScale;
	this.upsellPadding = 10 * textScale;
	this.titleTextSize = 45 * textScale;
	this.bodyTextSize = 30 * textScale;
	this.footerTextSize = 25 * textScale;

	var percLandscapeForupsellScale = Math.max(0, Math.min(1, CrossyUtils.inverseLerp(0, upsellScaleDownBreakpoint, percLandscape)));
	var upsellScale = THREE.Math.lerp(0.5, 1, percLandscapeForupsellScale);

	this.upsellButtonScale = 1 * upsellScale;
	
	//old trex coming out of phone
	//this.phone.width = 235 * 1.3 * upsellScale;
	//this.phone.height = 320 * 1.3 * upsellScale;
	
	//trex only
	this.phone.width = 300 * 1.3 * upsellScale;
	this.phone.height = 271 * 1.3 * upsellScale;

	//this.placeUpsellButtonsBelowEachOther = (containerRatio < upsellButtonsBelowEachOtherBreakPoint);  //JAB

	AppStoreInterstitial.resizeAndRepositionElements(true);
};

AppStoreInterstitial.resize = function() {
	if (!this.container.visible) return;

	// Determine container dimensions

	var aspectRatio = Game.canvas.width / Game.canvas.height;
	var percLandscape = CrossyUtils.inverseLerp(window.minAspect, window.maxAspect, aspectRatio);

	if (percLandscape > 0.4) {
		// Landscape!
		//this.placeUpsellButtonsBelowEachOther = false; //JAB

		var minSideMargin = 50;
		var minTopMargin = 50;
		var minBottomMargin = 120;
		var targetAspectRatio = 16 / 11;
		var maxHeight = Game.UI.height - minBottomMargin - minTopMargin;

		this.container.y = (minTopMargin - minBottomMargin) / 2;

		this.container.width = Game.UI.width - minSideMargin;
		this.container.height = this.container.width / targetAspectRatio;

		if (this.container.height > maxHeight) {
			this.container.height = maxHeight;
			this.container.width = maxHeight * targetAspectRatio;
		}

		var scale = this.container.height / maxHeight;

		this.padding = 25 * scale;
		this.upsellPadding = 10 * scale;
		this.titleTextSize = 45 * scale;
		this.bodyTextSize = 30 * scale;
		this.footerTextSize = 25 * scale;
		this.upsellButtonScale = 1 * scale;
		
		//old trex
		//this.phone.width = 235 * 1.3 * scale;
		//this.phone.height = 320 * 1.3 * scale;
		
		//trex only
		this.phone.width = 300 * 1.3 * scale;
		this.phone.height = 271 * 1.3 * scale;

		this.footerText.text = CrossyLocalisation.GetString("upsell-footer");
	} else {
		// Portrait!
		//this.placeUpsellButtonsBelowEachOther = true; //JAB

		var minSideMargin = 20;
		var minTopMargin = 20;
		var minBottomMargin = 120;
		var targetAspectRatio = 13 / 16;
		var maxHeight = Game.UI.height - minBottomMargin - minTopMargin;

		this.container.y = (minTopMargin - minBottomMargin) / 2;

		this.container.width = Game.UI.width - minSideMargin;
		this.container.height = this.container.width / targetAspectRatio;

		if (this.container.height > maxHeight) {
			this.container.height = maxHeight;
			this.container.width = maxHeight * targetAspectRatio;
		}

		var scale = this.container.height / maxHeight;

		this.padding = 25 * scale;
		this.upsellPadding = 10 * scale;
		this.titleTextSize = 35 * scale;
		this.bodyTextSize = 20 * scale;
		this.footerTextSize = 20 * scale;
		this.upsellButtonScale = 0.8 * scale;
		
		//old trex phone
		//this.phone.width = 235 * 1 * scale;
		//this.phone.height = 320 * 1 * scale;
		
		//trex only
		this.phone.width = 300 * 1.3 * scale;
		this.phone.height = 271 * 1.3 * scale;

		this.footerText.text = CrossyLocalisation.GetString("upsell-footer").replace('\n', ' ');
	}

	// Re-size and re-position everything
	this.resizeAndRepositionElements();
};

