FreeGift.getLastGiftTime = async function() {
    if (this.lastGiftTime !== null) return this.lastGiftTime;

    // Check if running in YouTube Playables environment
    if (ytgame?.IN_PLAYABLES_ENV) {
        const lastGiftTime = await getYTCloudItem(this.lastGiftTimeKey, 0);
        this.lastGiftTime = parseInt(lastGiftTime, 10);
    } else {
        // Fallback to local storage if not running on YouTube Playables
        const storedLastGiftTime = crossyStorage.getItem(this.lastGiftTimeKey);
        this.lastGiftTime = storedLastGiftTime !== null ? parseInt(storedLastGiftTime, 10) : 0;
    }

    return this.lastGiftTime || 0;
};

FreeGift.getGiftsGiven = async function() {
    if (this.giftsGiven !== null) return this.giftsGiven;

    // Check if running in YouTube Playables environment
    if (ytgame?.IN_PLAYABLES_ENV) {
        const giftsGiven = await getYTCloudItem(this.giftsGivenKey, 0);
        this.giftsGiven = parseInt(giftsGiven, 10);
    } else {
        // Fallback to local storage if not running on YouTube Playables
        const storedGiftsGiven = crossyStorage.getItem(this.giftsGivenKey);
        this.giftsGiven = storedGiftsGiven !== null ? parseInt(storedGiftsGiven, 10) : 0;
    }

    return this.giftsGiven || 0;
};





FreeGift.getTimeToGift = function() {
	var lastGiftTime = FreeGift.lastGiftTime || 0;  // fallback
	var giftsGiven = FreeGift.giftsGiven;      //
	
	//console.log("getTimeToGift start:::::: lastGiftTime",FreeGift.lastGiftTime);
	//console.log("getTimeToGift start:::::: giftsGiven",FreeGift.giftsGiven);
	

	var timeToCurrentGift = this.timeToGift[Math.min(giftsGiven, this.timeToGift.length - 1)];
	var msToCurrentGift = timeToCurrentGift * 60 * 1000;
	var timeSpentSinceLastGift = Date.now() - lastGiftTime;
	
	//console.log("Time to current gift (min):", timeToCurrentGift, "| Milliseconds to gift:", msToCurrentGift, "| Time spent since last gift (ms):", timeSpentSinceLastGift);

	
	//make sure it's not a negative number
	return Math.max(msToCurrentGift - timeSpentSinceLastGift, 0);  
	
};

FreeGift.getCurrentReward = function() {
	//var giftsGiven = this.getGiftsGiven();  // no need to go to storage again
	var giftsGiven = this.giftsGiven;

	return this.rewards[Math.min(giftsGiven, this.timeToGift.length - 1)];
};

FreeGift.timeToText = function(milliseconds) {
	var seconds = parseInt((milliseconds / 1000) % 60),
		minutes = parseInt((milliseconds / (1000 * 60)) % 60),
		hours = parseInt((milliseconds / (1000 * 60 * 60)) % 24);
		
	
	// if numbers are below 1 min, it displays 1m since there is no IN SECONDS localization

	// Any amount of seconds will reflect in the minutes
	minutes = Math.ceil(minutes + (seconds / 60));

	if (minutes === 60) {
		// Make sure this propogates to hours
		hours++;
	}

	//var textHours, textMinutes;
	
	// JAB make sure these have starting values otherwise could throw undefined
	//
	var textHours = 0;
    var textMinutes = 0;

	if (hours > 0) {
		textHours = hours;
	}

	if (minutes > 0 && minutes !== 60) {
		textMinutes = minutes;
	}

	var text;
	if (textHours && textMinutes) {
		text = CrossyLocalisation.GetString('free-gift-in-time');
	} else if (textHours) {
		text = CrossyLocalisation.GetString('free-gift-in-time-hours');
	} else {
		text = CrossyLocalisation.GetString('free-gift-in-time-minutes');
	}

	return text.trim().replace('XXX', textHours).replace('YYY', textMinutes);
}

FreeGift.areThereAnyGiftsLeft = function() {
	//old ---> return FreeGift.getGiftsGiven() < FreeGift.timeToGift.length;
	
	//return true;  //make it so there is always a free gift!
	
	return FreeGift.giftsGiven < FreeGift.timeToGift.length;
}

