FreeGift.giftWasAwarded = function() {
     // Increment the count of gifts given
    this.giftsGiven += 1;

    // Record the current time as the last gift time
    this.lastGiftTime = Date.now();

    // Prepare the data to update
    const updates = {
        lastGiftTime: this.lastGiftTime,
        giftsGiven: this.giftsGiven
    };

	// Check if YouTube Playables environment and saveGameData function are available
    if (ytgame?.game?.saveData) {
        // Use saveGameData to save the updates, which returns a promise
        return saveGameData(updates)
            .then(() => {
                //console.log("Gift data saved to YouTube cloud storage.");
            })
            .catch((error) => {
                console.error("Error saving gift data to YouTube cloud storage:", error);
                // Fallback to local storage if YouTube storage fails
                saveToLocalFallback(updates);
            });
    } else {
        // Fallback to local storage if YouTube SDK is not available
        crossyStorage.setItem(this.lastGiftTimeKey, this.lastGiftTime);
		crossyStorage.setItem(this.giftsGivenKey, this.giftsGiven);
    }
};
