FreeGiftScreen.prepareGiftMeshes = function() {
	this.giftMeshes = [];

	var models = [gift_1_optimised, gift_2_optimised, gift_3_optimised, gift_4_optimised, gift_5_optimised, gift_6_optimised, gift_7_optimised];

	models.forEach(function(model, idx) {
		var mesh = importMesh('gift_' + idx, model);
		mesh.visible = false;
		mesh.position.set(2.4, this.meshYBasePosition, -2);
		mesh.rotation.y = 45 * Math.PI / 180; // 45 degrees to radians
		this.scene.add(mesh);
		this.giftMeshes.push(mesh);
	}.bind(this));
}

