FreeGiftScreen.updateTargetGiftScale = function() {
	if (!this.activeGift) return;

	var aspectRatio = this.canvas.width / this.canvas.height;
	var percLandscape = CrossyUtils.inverseLerp(window.minAspect, window.maxAspect, aspectRatio);

	var scale = THREE.Math.lerp(FreeGiftScreen.meshScalePortrait, FreeGiftScreen.meshScaleLandscape, percLandscape);

	this.targetGiftScale.set(scale * this.meshXZScaleModifier, scale * this.meshYScaleModifier, scale * this.meshXZScaleModifier);
}

FreeGiftScreen.update = function(deltaTime) {
	// Text stuff
	if (!this.textTimer.isFinished()) {
		this.textTimer.Tick(deltaTime);

		var coinTextScale = 1 + (Easing.easeInOutCubic(this.textTimer.value) * 0.25);

		this.coinText.setScale(baseCoinTextSize * coinTextScale);

		this.coinIcon.width = baseCoinIconSize * coinTextScale;
		this.coinIcon.height = this.coinIcon.width;

		this.positionCoinElements();
	}

	if (!this.activeGift) return;

	// Tick those timers
	this.hopTimer.Tick(deltaTime);
	this.fallTimer.Tick(deltaTime);
	this.fallWobbleTimer.Tick(deltaTime);
	this.openTimer.Tick(deltaTime);

	// Position
	var hopDistance = giftHopHeight * Easing.easeOutQuad(this.fallTimer.value) + Easing.easeOutQuad(this.hopTimer.value);
	this.activeGift.position.y = this.meshYBasePosition + hopDistance;

	this.scaleActiveGift();

	if (this.hopTimer.reachedFinished() || this.fallTimer.reachedFinished()) {
		Game.playSfx('gift/booktap'); // volume 0.5? :()
	}

	if (this.fallWobbleTimer.isFinished() && !this.openingGift) {
		this.hopTrigger -= deltaTime;

		if (this.hopTrigger < 0) {
			this.hopTimer.Reset();
			this.hopTrigger += CrossyUtils.getRandomArbitrary(3, 5);
		}
	}

	if (this.openingGift && this.openTimer.isFinished()) {
		this.awardGift();
	}
};

FreeGiftScreen.positionCoinElements = function () {
	this.coinIcon.x = this.coinText.width * 0.5;
	this.coinIcon.y = this.coinText.height * 0.5;

	this.coinContainer.x = -this.coinIcon.width * 0.5;
	this.coinContainer.x = -this.coinIcon.width * 0.5;
}

FreeGiftScreen.awardGift = function(reward) {
	// Make sure this will never work unless we have a gift ready
	if(FreeGift.getTimeToGift() > 0) return;
	
	var reward = FreeGift.getCurrentReward() || 5;  // Fallback to 0 if undefined

	//var reward = FreeGift.getCurrentReward(); 

	this.coinText.setText(reward.toString());
	this.coinContainer.visible = true;

	this.coinText.visible = true;
	this.coinIcon.visible = true;

	this.positionCoinElements();

	this.activeGift.visible = false;
	this.activeGift = null;

	this.flashOverlay.alpha = 1;
	this.flashOverlay.visible = true;

	// Award gift right away
	GameSave.ModifyCoins(reward)
	CrossyUI.coinsWereModified();

	FreeGift.giftWasAwarded();
	
	// Save after awarding the free gift
    //saveGameData();

	// Hold screen white for 100ms before moving on
	window.setTimeout(function() {
		this.flashOutTween.start();
		this.textTimer.Reset();

		// Make additional elements visible
		this.playButton.visible = true;
		this.timeToGiftText.visible = true;

		KeyboardUIControls.setFocus(this.playButton);

		var timeToGift = FreeGift.getTimeToGift();
		this.timeToGiftText.text = FreeGift.timeToText(timeToGift);

		Game.playSfx('gift/Earn_Points');

		// First confetti!
		this.confettiBlast(20);

		// More confetti after 200 ms
		window.setTimeout(function() {
			this.confettiBlast(20);
		}.bind(this), 200);

		// Another flash and then the coins after 400ms
		window.setTimeout(function() {
			this.flashOverlay.alpha = 1;
			this.flashOverlay.visible = true;

			// Hold screen white for 100ms before moving on
			window.setTimeout(function() {
				this.flashOutTween.start();

				CrossyUI.coinBlast(reward);
			}.bind(this), 100);   // tested to 80, meh
		}.bind(this), 400);
	}.bind(this), 100);
}

FreeGiftScreen.scaleActiveGift = function () {

	if (!this.activeGift) return;

	var fallWobbleScale = new THREE.Vector3(1, 1, 1)
		.lerp(
			new THREE.Vector3(1.05, 0.95, 1.05),
			this.hopTimer.value + Easing.easeInOutCubic(this.fallWobbleTimer.value)
		);

	var openTime = Easing.easeOutQuart(this.openTimer.value);
	var openScale = -openTime * 0.25 * THREE.Math.lerp(1, CrossyUtils.getRandomArbitrary(0.9, 1), openTime);

	var scale = fallWobbleScale.addScalar(openScale).multiply(this.targetGiftScale);

	this.activeGift.scale.set(scale.x, scale.y, scale.z);
}

FreeGiftScreen.resize = function() {
	this.updateTargetGiftScale();
	this.scaleActiveGift();
};

FreeGiftScreen.confettiBlast = function(amount) {
	var confettiSize = 50;

	var confettiParent = this.ui.createRectangle('rgba(0,0,0,0)');
	confettiParent.anchor.x = ThreeUI.anchors.center;
	confettiParent.anchor.y = ThreeUI.anchors.center;

	this.confettis = [];

	for(var confettiIdx = 0;confettiIdx < amount;confettiIdx++){
		var confetti = this.ui.createRectangle('#ffee44');
		confetti.anchor.x = ThreeUI.anchors.center;
		confetti.anchor.y = ThreeUI.anchors.center;
		confetti.height = confettiSize * CrossyUtils.getRandomArbitrary(0.02, 0.4);
		confetti.width = confettiSize * CrossyUtils.getRandomArbitrary(0.8, 1);
		confetti.parent = confettiParent;
		confetti.rotation = CrossyUtils.getRandomInt(-50, 50)

		this.confettis.push(confetti);

		var direction = new THREE.Vector2(CrossyUtils.getRandomArbitrary(-1, 1), CrossyUtils.getRandomArbitrary(-1, 1)).normalize();

		confetti.x = CrossyUtils.getRandomArbitrary(20, 75) * direction.x;
		confetti.y = CrossyUtils.getRandomArbitrary(20, 75) * direction.y;

		var targetX = confetti.x + CrossyUtils.getRandomArbitrary(50, 250) * direction.x;
		var targetY = confetti.y + CrossyUtils.getRandomArbitrary(0, 150) * direction.y;
		var targetRotation = confetti.rotation * CrossyUtils.getRandomArbitrary(1.1, 1.3);

    	new TWEEN.Tween(confetti)
			.to({ x: targetX, y: targetY, rotation: targetRotation }, 500)
			.easing(TWEEN.Easing.Quartic.Out)
			.onComplete(function(){
				FreeGiftScreen.removeConfetti(this);
			})
			.start();
	}

	// Gravity
	new TWEEN.Tween(confettiParent)
		.to({ y: confettiParent.y + 50 }, 500)
		.onComplete(function() {
			this.ui.delete(confettiParent)
		}.bind(this))
		.easing(TWEEN.Easing.Quartic.In)
		.delay(250)
		.start();
}

FreeGiftScreen.removeConfetti = function(confetti) {
	var deleteConfetti = (function(confetti) {
		this.ui.delete(confetti);
	}).bind(this, confetti);

	new TWEEN.Tween(confetti)
		.to({ width: 0, height: 0 }, 200)
		.onComplete(function() {
			deleteConfetti();
		})
		.start();
};
var KeyboardUIControls = {};

KeyboardUIControls.sprites = {
	default: 'focus.png',
	wide: 'focus-wide.png',
	square: 'focus-square-small.png',
	keyboard: 'focus-keyboard.png',
	upsellClose: 'focus-upsell-close.png',
	upsell: 'focus-upsell.png',
	upsellBlink: 'focus-upsell-blink.png'
};

KeyboardUIControls.init = function() {
	//if (window.isMobile) return;  //try comment this out JAB

	this.reticle = Game.UI.createSpriteFromSheet(this.sprites.default, 'sprites/CrossyUI.png', 'sprites/CrossyUI.json');
	this.reticle.stretch.x = true;
	this.reticle.stretch.y = true;
	this.reticle.anchor.x = ThreeUI.anchors.center;
	this.reticle.anchor.y = ThreeUI.anchors.center;
    this.reticle.parent = buttonParent;  
	//this.reticle.parent = null;   //JAB
	this.reticle.visible = false;
	this.reticle.pivot.x = 0;
	this.reticle.pivot.y = 0;
};

KeyboardUIControls.setFocus = function(button) {
	if (window.isMobile || !button || !this.reticle || this.reticle.parent === button || this.disabled) return;

	this.timeSinceLastBlink = 0;

	// Make sure our previous focus is reverted to non blinking version
	if (this.reticle.parent && this.reticle.parent.blinkSprite && this.reticle.parent.defaultSprite && !this.reticle.parent.disabled) {
		this.reticle.parent.setAssetPath(this.reticle.parent.defaultSprite);
	}

	// Immediately "blink" current focus
	if (button.blinkSprite && !button.disabled) {
		button.setAssetPath(button.blinkSprite);
	}

	this.reticle.parent = button;

	if (button.assetPath.indexOf('keyboard') > -1) {
		this.reticle.setAssetPath(this.sprites.keyboard);
	} else if (button.assetPath.indexOf('upsell-close') > -1) {
		this.reticle.setAssetPath(this.sprites.upsellClose);
	} else if (button.assetPath.indexOf('upsell-') > -1) {
		this.reticle.setAssetPath(this.sprites.upsellBlink);
	} else if (button.width === button.height) {
		this.reticle.setAssetPath(this.sprites.square);
	} else if (button.width > (button.height * 1.6)) {
		this.reticle.setAssetPath(this.sprites.wide);
	} else {
		this.reticle.setAssetPath(this.sprites.default);
	}

	this.reticle.visible = true;
};

KeyboardUIControls.disable = function() {
	this.disabled = true;
}

KeyboardUIControls.enable = function() {
	this.disabled = false;
}

KeyboardUIControls.getFocus = function() {
	 
	// JAB added checks 
	if (!this.reticle || !this.reticle.parent) {
        console.warn('KeyboardUIControls.getFocus: Reticle or its parent is undefined during touch interaction');
        return null; // Fallback to a safe default
    }
	
	
	return this.reticle.parent;
}

KeyboardUIControls.timeSinceLastBlink = 0;
KeyboardUIControls.update = function(deltaTime) {
	if (window.isMobile || this.disabled) return;

	var button = this.reticle.parent;
	if (!button.disabled) {
		// Blink things
		if (this.timeSinceLastBlink >= 0.4) {
			if (button.blinkSprite && button.defaultSprite) {
				if (button.assetPath === button.defaultSprite) {
					button.setAssetPath(button.blinkSprite);
				} else {
					button.setAssetPath(button.defaultSprite);
				}
			} else if (this.reticle.assetPath === this.sprites.upsell) {
				this.reticle.setAssetPath(this.sprites.upsellBlink);
			} else if (this.reticle.assetPath === this.sprites.upsellBlink) {
				this.reticle.setAssetPath(this.sprites.upsell);
			}

			this.timeSinceLastBlink = 0;
		} else {
			this.timeSinceLastBlink += deltaTime;
		}
	}
}

KeyboardUIControls.handleKeyEvent = function(event) {
	if (!Game.takesUserInput || this.disabled) return;

	var button = this.reticle.parent;

	if (event.keyCode === 32 || event.keyCode === 13) {
		// Enter or spacebar, fire click event for currently focused button
		if (!button.disabled) {
			this.reticle.parent.fireEvent('click');
		}
		return;
	}

	var left = false,
		right = false,
		top = false,
		bottom = false,
		exit = false;

	switch (event.keyCode) {
		case 87: case 38:
		top = true;
		break;
		case 65: case 37:
		left = true;
		break;
		case 83: case 40:
		bottom = true;
		break;
		case 68: case 39:
		right = true;
		break;
		case 27:
		exit = true;
		break;
	}

	if (exit) {
		if (AppStoreInterstitial.isVisible() && CrossyUI.CurrentScreen !== 'death') {
			AppStoreInterstitial.hide();
			return;
		}

		if (CrossyUI.CurrentScreen === 'selectingCharacter') {
			Carousel.close();
			return;
		}
	}

	// No directional key either, nevermind!
	if (!left && !right && !top && !bottom) return;

	if (CrossyUI.CurrentScreen === 'selectingCharacter' && (left || right) && !AppStoreInterstitial.isVisible()) {
		KeyboardUIControls.CarouselNavigation(left, right);
		return;
	}

	if (left && button.navigateOnLeft) {
		var navigateTo = button.navigateOnLeft;
		if (typeof button.navigateOnLeft === 'function'){
			navigateTo = navigateTo();
		}
		this.setFocus(navigateTo);
		return;
	}

	if (right && button.navigateOnRight) {
		var navigateTo = button.navigateOnRight;
		if (typeof navigateTo === 'function'){
			navigateTo = navigateTo();
		}
		this.setFocus(navigateTo);
		return;
	}

	if (top && button.navigateOnTop) {
		var navigateTo = button.navigateOnTop;
		if (typeof navigateTo === 'function'){
			navigateTo = navigateTo();
		}
		this.setFocus(navigateTo);
		return;
	}

	if (bottom && button.navigateOnBottom) {
		var navigateTo = button.navigateOnBottom;
		if (typeof navigateTo === 'function'){
			navigateTo = navigateTo();
		}
		this.setFocus(navigateTo);
		return;
	}
}

KeyboardUIControls.CarouselNavigation = function(left, right) {
	if (left) {
		Carousel.btnLeftCallBack(true);
	}

	if (right) {
		Carousel.btnRightCallBack(true);
	}
}

