	this.buyButton.visible = false;
	this.backButton.visible = false;

	this.unlockedCharacter = Carousel.UnlockRandomCharacter(); // Immediately unlock character
	
	// JAB save to YT cloud after gumball
	// 
    saveGameData();

	var numUnlocked = Carousel.HowManyUnlocked().number - 1;
	var unlockedName = Carousel.characters[this.unlockedCharacter.idx].fullName.toLowerCase().replace(/ +/, '_');
	//analytics.track('character_unlocked', unlockedName, numUnlocked, numUnlocked);

	// Go-go gadget event timers
	this.timeToLeverTimer.Reset();
	this.timeToJiggleTimer.Reset();
	this.timeToPrizeEjectTimer.Reset();
	this.timeToOpenPrizeTimer.Reset();
	this.timeToResetTimer.Reset();

