/**
 * Determines which feature should be shown based on round id and the feature check
 */

MetaHelper.getFeaturesByRound = function(round) {
	var features = [];
	var noMoreFeatures = false;

	MetaHelper.features.forEach(function(feature) {
		if (noMoreFeatures) return;

		if (feature.check(round)) {
			var result = {
				key: feature.key
			};

			if (feature.overridesAllOtherFeatures) {
				noMoreFeatures = true;
				features = [result];
			} else {
				features.push(result);
			}
		}
	});

	if (window.firstIterationToggle) {
		if (CrossyUI.tutorialWasLockedLastRound && features.length === 0) {
			// We should alway show a bar the round after tutorial!
			features.push({ key: 'free-gift' });
		}
	}

	return features;
};

var dataPoints = 250;
var fpsTracker = {
	fps: [],
	tracked: 0,
	lowPoint: Infinity,
	highPoint: 0,
	update: function(deltaTime) {
		if (this.tracked >= 3) return;

		var currentRate = 1000 / deltaTime / 1000;

		this.fps.push(currentRate);
		this.lowPoint = Math.min(this.lowPoint, currentRate);
		this.highPoint = Math.max(this.highPoint, currentRate);

		if (this.fps.length === dataPoints) {
			var rates = [];
			var total = 0;
			while (this.fps.length > 0) {
				var rate = this.fps.pop();
				total += rate;

				rates.push(rate);
			}

			var avgFps = Math.round(total / dataPoints);

			var amountBelowHalfOfAverage = 0;
			for (var idx = 0;idx < rates.length;idx++) {
				var rate = rates[idx];
				if (rate <= avgFps / 2) {
					amountBelowHalfOfAverage++;
				}
			}

			//analytics.track('technical_performance', 'fps', 'average', avgFps);
			// analytics.track('technical_performance', 'fps', 'low_point', Math.max(this.lowPoint, 0));
			//analytics.track('technical_performance', 'fps', 'high_point', Math.min(this.highPoint, 60));
			//analytics.track('technical_performance', 'fps', 'perc_below_half_of_average', Math.max(amountBelowHalfOfAverage / dataPoints, 0));

			this.tracked++;
		}
	},
};

