window.crossyStorage = {
	noStorage: null,
	data: {}, // used if localStorage is not accessible (i.e. Safari's incognito mode)

	detectLocalStorage: function() {
		this.noStorage = false;

		try {
			console.log('hi')
		} catch(e) {
			this.noStorage = true;
		}
	},

	getItem: function(key) {
		if (this.noStorage === null) this.detectLocalStorage();

		if (this.noStorage) {
			// Make sure we return null for undefined, because that's how localStorage functions
			if (typeof this.data[key] === 'undefined') return null;
			return this.data[key];
		}

		// If we can, retrieve data from memory
		if (typeof this.data[key] !== 'undefined') return this.data[key];

		var value = localStorage.getItem(key);

		// Store locally so we can retrieve from memory later
		this.data[key] = value;

		return value;
	},

	setItem: function(key, value) {
		if (this.noStorage === null) this.detectLocalStorage();

		// Always save data to memory so we don't have to do localStorage reads later on for this
		this.data[key] = value;

		if (this.noStorage) return;

		localStorage.setItem(key, value);
	}
};
