/////////////////////////////////////////////
//  Get coins from cloud/storage
/////////////////////////////////////////////
GameSave.GetCoins = function () {
    //console.log("Calling GetCoins()");


	// JAB - do we need to resolve with promise?
	//
    return new Promise((resolve) => {
        // Check if YouTube SDK is available
        if (ytgame?.IN_PLAYABLES_ENV) {
            getYTCloudItem('Crossycoins', 0)
                .then((cloudCoins) => {
                    let coins = Math.round(cloudCoins);
                    if (coins == null || isNaN(coins) || coins < 0) {
                        coins = 0; // Set to 0 if invalid
                    }
                    //console.log("Retrieved coins from YouTube cloud:", coins);
                    resolve(coins); // Resolve with the retrieved coins
                })
                .catch((error) => {
                    console.error("Error retrieving coins from YouTube cloud storage:", error);
                    resolve(0); // Resolve with 0 if there's an error
                });
        } else {
            // Fallback to crossyStorage if YouTube SDK is not available
            let coins = crossyStorage.getItem('Crossycoins');
            coins = Math.round(coins);
            if (coins == null || isNaN(coins) || coins < 0) {
                coins = 0;
            }
            resolve(coins); // Resolve with local storage coins
        }
    });
};
