GameSave.ModifyCoins = function (delta) {
    //console.log("Calling ModifyCoins() with delta value:", delta);

    let coins = 0;

    if (ytgame?.IN_PLAYABLES_ENV) {
        return waitForYTGameInitialization()
            .then(() => {
                const coinPromise = getYTCloudItem('Crossycoins', 0);

                // Log and validate coinPromise is a Promise
                //console.log("coinPromise from getYTCloudItem:", coinPromise);
                if (!(coinPromise instanceof Promise)) {
                    throw new Error("getYTCloudItem did not return a Promise.");
                }

                return coinPromise;
            })
            .then((retrievedCoins) => {
                //console.log("retrievedCoins:", retrievedCoins);
                coins = Math.round(retrievedCoins);
                if (coins == null || isNaN(coins) || coins < 0) {
                    coins = 0;
                }
                coins += delta;
                Game.coins = coins;

                return saveGameData({ coins: Game.coins }).then(() => {
                    //console.log("Coins updated and saved to YouTube cloud.");
                    return coins;
                }).catch((error) => {
                    console.error("Error saving coins to YouTube cloud:", error);
                    return coins;
                });
            })
            .catch((error) => {
                console.error("Error initializing YouTube SDK or retrieving coins:", error);
                return 0;
            });
    } else {
        // Fallback for non-YouTube environment
        coins = parseInt(crossyStorage.getItem('Crossycoins'), 10);
        coins = Math.round(coins);
        if (coins == null || isNaN(coins) || coins < 0) {
            coins = 0;
        }
        coins += delta;
        crossyStorage.setItem('Crossycoins', coins);
        Game.coins = coins;
        return Promise.resolve(coins);
    }
};


