function saveGameData(updates = {}) {
    // Merge updates with current game data
    const dataToSave = {
        topScore: Game.topScore,
        mute: Game.mute,
        unlockedCharacters: Game.unlockedCharacters, // Character indices or IDs
        coins: Game.coins,
        hasPlayedBefore: Game.hasPlayedBefore,
        currCharacter: Game.currCharacter || 0,
        hasSeenCarousel: Game.hasSeenCarousel,
        deathsSinceLastCharacterUnlock: Game.deathsSinceLastCharacterUnlock,
        lastGiftTime: FreeGift.lastGiftTime,   //I think this is better to use than Game.lastGiftGiven
        giftsGiven: FreeGift.giftsGiven,       //
        isSoundEnabled: Game.isSoundEnabled,
        firstRoundFinished: Game.firstRoundFinished,
        secondRoundFinished: Game.secondRoundFinished,
        ...updates // Apply updates passed as parameters
    };

    const serializedData = JSON.stringify(dataToSave);

    // Return the promise from saveData so that this function is chainable
    return ytgame.game.saveData(serializedData)
        .then(() => {
            //console.log("Game data saved successfully!");
			//console.log("game data:", serializedData);
        })
        .catch((error) => {
            console.error("Failed to save game data: ", error);
            throw error; // Ensure a rejected Promise in case of failure
        });
}



////////////////////////////////////////////////////////////
// Get YouTube Item from Cloud
///////////////////////////////////////////////////////////

function getYTCloudItem(key, defaultValue) {
    //console.log("Attempting to get cloud item...:", key);

    if (ytgame && ytgame.IN_PLAYABLES_ENV && ytgame.game && typeof ytgame.game.loadData === 'function') {
        return ytgame.game.loadData()
            .then((data) => {
                if (data) {
                    const savedData = JSON.parse(data);
                    //console.log(`Loaded saved data for key "${key}":`, savedData[key]);
                    return savedData[key] !== undefined ? savedData[key] : defaultValue;
                } else {
                    console.log("No data found in YouTube cloud storage."); // Move this log before the return
                    return defaultValue; // No data found
                }
            })
            .catch((error) => {
                console.error(`Failed to load data for key: ${key}`, error);
                return defaultValue;
            });
    } else {
        console.warn("YouTube environment or loadData not available; using default value for:", key);
        return Promise.resolve(defaultValue); // Ensure a Promise is returned
    }
}



function waitForYTGameInitialization() {
    return new Promise((resolve, reject) => {
        let sdkInitialized = false;

        const checkInterval = setInterval(() => {
            //console.log("Checking YouTube SDK initialization...");

            if (!sdkInitialized && ytgame && ytgame.IN_PLAYABLES_ENV && ytgame.game && typeof ytgame.game.loadData === 'function') {
                //console.log("YouTube SDK initialization detected. Waiting briefly to ensure readiness...");
                sdkInitialized = true;
                clearInterval(checkInterval);
                clearTimeout(dataLoadTimeout);

                // Wait 100ms to ensure all SDK components are ready
                setTimeout(() => {
                    console.log("YouTube SDK fully ready.");
                    resolve();
                }, 100);
            }
        }, 100); // Check every 100ms

        // Timeout to reject if initialization fails within 5 seconds
        const dataLoadTimeout = setTimeout(() => {
            if (!sdkInitialized) {
                clearInterval(checkInterval);
                console.error("YouTube SDK did not initialize in time.");
                reject(new Error("YouTube SDK did not initialize in time."));
            }
        }, 5000);
    });
}


////////////////////////////////////////////////////////////////////////////
// LOAD ALL CLOUD DATA - happens once at the beginning of loading the game
/////////////////////////////////////////////////////////////////////////////
function loadYTCloudGameData() {
    return new Promise((resolve, reject) => {
        try {
            const isYouTubeEnv = ytgame && ytgame.IN_PLAYABLES_ENV === true;
            //console.log("Getting Cloud Data-> YouTube environment:", isYouTubeEnv);

            if (isYouTubeEnv) {
				//console.log("loading...................");
                // Load data from YouTube cloud storage in parallel
                Promise.all([
                    getYTCloudItem('topScore', 0),
                    getYTCloudItem('mute', false),
                    getYTCloudItem('unlockedCharacters', []),
                    getYTCloudItem('Crossycoins', 0),
                    getYTCloudItem('hasPlayedBefore', false),
                    getYTCloudItem('currCharacter', 'chicken'),
                    getYTCloudItem('hasSeenCarousel', false),
                    getYTCloudItem('deathsSinceLastCharacterUnlock', 0),
                    getYTCloudItem('lastGiftTime', Date.now()),
                    getYTCloudItem('giftsGiven', 1),
                    getYTCloudItem('isSoundEnabled', true),
                    getYTCloudItem('firstRoundFinished', false),
                    getYTCloudItem('secondRoundFinished', false)
                ]).then(([topScore, mute, unlockedCharacters, coins, hasPlayedBefore, currCharacter, hasSeenCarousel, deathsSinceLastCharacterUnlock, lastGiftTime, giftsGiven, isSoundEnabled, firstRoundFinished, secondRoundFinished]) => {
                    // Assign data to Game object
                    Game.topScore = topScore;
                    Game.mute = mute;
                    Game.unlockedCharacters = unlockedCharacters;
                    Game.coins = coins;
                    Game.hasPlayedBefore = hasPlayedBefore;
                    Game.currCharacter = currCharacter;
                    Game.hasSeenCarousel = hasSeenCarousel;
                    Game.deathsSinceLastCharacterUnlock = deathsSinceLastCharacterUnlock;
                    Game.lastGiftTime = lastGiftTime;   // not sure this is needed
					FreeGift.lastGiftTime = lastGiftTime || Date.now(); // Fallback if missing
                    Game.giftsGiven = giftsGiven;      // not sure this is needed
					//FreeGift.giftsGiven = 0;
					FreeGift.giftsGiven = giftsGiven || 1;
                    Game.isSoundEnabled = isSoundEnabled;
                    Game.firstRoundFinished = firstRoundFinished;
                    Game.secondRoundFinished = secondRoundFinished;
					//Game.firstRoundFinished = false;
                    //Game.secondRoundFinished = false;

                    //console.log("Cloud data loaded in loadYTCloudGameData().");

                    //if (Game.mute) CrossyUI.ToggleMute();  //Toggle mute is not defined at this point...when this func is called

                    resolve(); // Resolve after successfully loading all data
                }).catch(error => {
                    console.error("Error retrieving cloud data:", error);
                    reject(error); 
                });
            } else {
                // Fallback to local storage if not in YouTube environment
                Game.topScore = parseInt(crossyStorage.getItem('topScore') || 0);
                Game.mute = crossyStorage.getItem('mute') === 'true';
                Game.unlockedCharacters = JSON.parse(crossyStorage.getItem('unlockedCharacters') || '[]');
                Game.coins = parseInt(crossyStorage.getItem('Crossycoins') || 0);
                Game.hasPlayedBefore = crossyStorage.getItem('hasPlayedBefore') === 'true';
                Game.currCharacter = crossyStorage.getItem('currCharacter') || 'chicken';
                Game.hasSeenCarousel = crossyStorage.getItem('hasSeenCarousel') === 'true';
                Game.deathsSinceLastCharacterUnlock = parseInt(crossyStorage.getItem('deathsSinceLastCharacterUnlock') || 0);
                Game.lastGiftTime = parseInt(crossyStorage.getItem('lastGiftTime') || Date.now());
                Game.giftsGiven = parseInt(crossyStorage.getItem('giftsGiven') || 0);
                Game.isSoundEnabled = crossyStorage.getItem('isSoundEnabled') !== 'false';
                Game.firstRoundFinished = crossyStorage.getItem('firstRoundFinished') === 'true';
                Game.secondRoundFinished = crossyStorage.getItem('secondRoundFinished') === 'true';

                //console.log("Local data loaded in loadYTCloudGameData().");

                //if (Game.mute) CrossyUI.ToggleMute();

                resolve(); 
            }
        } catch (error) {
            console.error("Error in loadYTCloudGameData():", error);
            reject(error);
        }
		if (Game.mute && !Game.isSoundEnabled) { 
			isSound = false;
			CrossyUI.ToggleMute();
		}
    });
}

