    this.textShadowMat = new THREE.MeshBasicMaterial({ color: 0x000000, side: THREE.FrontSide, transparent: true });
    this.textShadowMat.opacity = 0.4;
    this.currentText;
    this.strips = {};

    var loader = new THREE.FontLoader();
