var keyMustWaitUntilUp = {};

function onDocumentKeyUp(event) {
    keyMustWaitUntilUp[event.keyCode] = false;

    if (!Game.takesUserInput) return;

    if(event.keyCode==80 || gamePaused){
        CrossyUI.TogglePause();
        return;
    }

    if (!playing) return;

    switch (event.keyCode) {
        case 87: case 38: //key w
            forward(true);
            break;
        case 65: case 37:   //key a
            left(true);
            break;
        case 83: case 40: //key
            back(true);
            break;
        case 68: case 39: //key d
            right(true);
            break;
    }
}

function left(finished) {
    if (finished) {
        Game.playerController.checkBump = true;
        Game.playerController.nextPlayerAction = "left";
        Game.playerController.moved = true;

        if (isMobile) {
            Game.playerController.SetDesiredRotationForDirection("left");
        }
    }
    else {
        if (!isMobile) {
            Game.playerController.SetDesiredRotationForDirection("left");
        }

        Game.playerController.nextPlayerAction = "Down";
    }
}

function right(finished) {
    if (finished) {
        Game.playerController.checkBump=true;
        Game.playerController.nextPlayerAction = "right";
        Game.playerController.moved = true;

        if (isMobile) {
            Game.playerController.SetDesiredRotationForDirection("right");
        }
    }
    else {
        if (!isMobile) {
            Game.playerController.SetDesiredRotationForDirection("right");
        }

        Game.playerController.nextPlayerAction = "Down";
    }
}

function forward(finished) {
    if (finished) {
        Game.playerController.checkBump=true;
        Game.playerController.nextPlayerAction = "forward";
        Game.playerController.moved = true;

        if (isMobile) {
            Game.playerController.SetDesiredRotationForDirection("forward");
        }
    }
    else {
        if (!isMobile) {
            Game.playerController.SetDesiredRotationForDirection("forward");
        }

        Game.playerController.nextPlayerAction = "Down";
    }
}

function back(finished) {
    if (finished) {
        Game.playerController.checkBump=true;
        Game.playerController.nextPlayerAction = "back";
        Game.playerController.moved = true;

        if (isMobile) {
            Game.playerController.SetDesiredRotationForDirection("back");
        }
    }
    else {
        if (!isMobile) {
            Game.playerController.SetDesiredRotationForDirection("back");
        }
        Game.playerController.nextPlayerAction = "Down";
    }
}

function onDocumentKeyDown(event) {
    if (!Game.takesUserInput) return;

    // Interactions should only be checked once per down-up interaction, make sure we're not double checking a held key
    if (keyMustWaitUntilUp[event.keyCode]) return;
    keyMustWaitUntilUp[event.keyCode] = true;

    switch (event.keyCode) {
        case 87: case 38: // key w
        case 65: case 37: // key a
        case 83: case 40: // key s
        case 68: case 39: // key d
            event.preventDefault();
            break;
    }

    // paused
    if (gamePaused || event.keyCode === 80) {
        return;
    }

    // If we are not ingame, let KeyboardUIControls handle it
    if (!playing || Game.playerController.Dead) {
        KeyboardUIControls.handleKeyEvent(event);
        return;
    }

    // Gameplay checks below, these should be checked every frame, so unset keyMustWaitUntilUp
    keyMustWaitUntilUp[event.keyCode] = false;

    switch (event.keyCode) {
        case 87: case 38: // key w
            forward(false);
            break;
        case 65: case 37: // key a
            left(false);
            break;
        case 83: case 40: // key s
            back(false);
            break;
        case 68: case 39: //key d
            right(false);
            break;
    }
}

var xDown = null;
var yDown = null;

function onDocumentTouchStart(event) {
	//console.log("ON DOC TOUCH START");
    xDown = event.touches[0].clientX;
    yDown = event.touches[0].clientY;
	
	// Reset any previous state
    prevXMove = null;
	
	//console.log("Touch start detected:", { xDown, yDown });
	
    if (playing) forward(false);

    if (CrossyUI.CurrentScreen === 'selectingCharacter') {
        Carousel.ProcessTouchStart();
    }
};

var prevXMove = null;
function onDocumentTouchMove(event) {
	//console.log("ON DOC TOUCH MOVE");
	
	
    // prevent dragging the page on mobile safari
    if (isMobile) {
        event.preventDefault();
    }

    var xUp = event.touches[0].clientX;
    var yUp = event.touches[0].clientY;

    var xDiff = xDown - xUp;
    var yDiff = yDown - yUp;

    if (CrossyUI.CurrentScreen == "selectingCharacter") {
        var xMove = event.touches[0].clientX;
        if (prevXMove === null) {
            prevXMove = xMove;
        }

        var xMovement = xMove - prevXMove;

        Carousel.ProcessTouchMove(xMovement);

        prevXMove = xMove;
        return;
    }

    if (!xDown || !yDown || !playing) {
        return;
    }

    if (Math.abs(xDiff) > Math.abs(yDiff) * 1.1) {  //most significant
        if (xDiff > 0) {
            // left swipe 
            left(false);
        } else {
			// right swipe 
            right(false);
        }
    } else {
        if (yDiff > 0) {
            // up swipe 
            forward(false);
			//console.log("Touch move FORWARD false!");
        } else {
            // down swipe 
            back(false);
        }
    }
};

function onDocumentTouchEnd(event) {
	//console.log("ON DOC TOUCH END");
	
	//console.log("AppStoreInterstitial.container.visible:",AppStoreInterstitial.container.visible);
	//console.log("Current Screen: ", CrossyUI.CurrentScreen);


 
    prevXMove = null;
    var xUp = event.changedTouches[0].clientX;
    var yUp = event.changedTouches[0].clientY;

    //if (Game.takesUserInput && gamePaused) {
    //   CrossyUI.unPause();
    //}
	if (Game.takesUserInput && gamePaused && !AppStoreInterstitial.container.visible) {
		CrossyUI.unPause();
	}
	

    if (CrossyUI.CurrentScreen === 'selectingCharacter') {
        Carousel.ProcessTouchEnd();
    }

    if (Game.playerController.nextPlayerAction == 'none') {
        //we want to prevent clicking on buttons causing weirdness
        return;
    }

    var xDiff = xDown - xUp;
    var yDiff = yDown - yUp;
	
	//console.log("Touch end detected diffs:", { xDiff, yDiff });
	
	const swipeThreshold = 10;
	
	// no swipe
	if (Math.abs(xDiff) < swipeThreshold && Math.abs(yDiff) < swipeThreshold)
	{
		//console.log("touchend: no swipe!");
        forward(true);
        return;
    }
	
	
	// origin code
    if (Math.abs(xDiff) > Math.abs(yDiff) * 1.1) { //most significant
        if (xDiff > 0) {
            // left swipe 
            left(true);
			//console.log("Touch end LEFT!");
        } else {
            // right swipe 
            right(true);
        }
    } else {
        if (yDiff > 0) {
            //* up swipe 
            forward(true);
			//console.log("Touch end FORWARD!");
        } else {
            //* down swipe 
            back(true);
        }
    } 
	
		
    // reset values 
    xDown = null;
    yDown = null;
}


function isLandscape() {
    return window.innerWidth > window.innerHeight;
}

function getSwipeThreshold() {
    return isLandscape() ? 0.15 : 0.1; // Higher threshold for landscape
}
