var rapidsSpeedMultiplier = 3;
var coinRestingHeight = 0.5

function LogSpawner() {}

LogSpawner.prototype = {
    SpawnALog: function(deltaTime, x, y, z) {
		var log = Log.Get("asdse", this.logVariation, this.moveSpeed, this.direction, x, y, z);

		var rapidsSpeed = log.speed * rapidsSpeedMultiplier;
		var distanceInRapids = log.logEdge - log.object.position.x;
		var timeInRapids = distanceInRapids / rapidsSpeed;

		if (timeInRapids <= deltaTime) {
			// Move log through rapids first and then remainder of deltaTime
			log.object.position.x += rapidsSpeed * timeInRapids;
			log.object.position.x += log.speed * (deltaTime - timeInRapids);
		} else {
			// Just move log through rapids
			log.object.position.x += rapidsSpeed * deltaTime;
        }
        
        if (Math.random() <= Strip.coinSpawnChance / 3) {
            var coin;
            if (Math.random() <= Strip.redCoinChance) {
                coin = objectPooler.GetItemOfType("red-coin");
            } else {
                coin = objectPooler.GetItemOfType("asd14");
            }

            coin.position.set(log.object.position.x, y + coinRestingHeight, z);
            coin.matrixAutoUpdate = false;
            coin.updateMatrix();

            log.addCoin(coin);            
        }
		
        this.logs.push(log);
        log.lparent = this;
        return log;
    },

    pool: function() {
        while (this.logs.length > 0) {
            this.logs.pop().pool();
        }

        Game.removefromPhysics(this);
        logSpawnerPool.push(this);
    },

    GetNewSpeed: function() {
        var maxSpeed = 2 + Math.min(Math.max(Game.CurrentRow, 0) / 1000.0, 5);
        if (Math.max(Game.CurrentRow, 0) > 300) {
            maxSpeed += Math.max(Game.CurrentRow, 0) / 300;
        }

        var Speed = Math.min(2 + (Math.random() * maxSpeed), 7);
        return Speed;
    },

    /**
    * @jscrambler disable *
    */
    tick: function(deltaTime) {
        this.nextSpawnTimer -= deltaTime;
        while (this.nextSpawnTimer <= 0) {
            // Change log type "consistency" randomly
            if (this.poopLane) {
                this.logVariation = GetRandomWorldPieceVariation("asdse");
            }
            // Move them forward the difference in time.
            this.SpawnALog(Math.abs(this.nextSpawnTimer), this.position.x, this.position.y, this.position.z); 
            var dt = ((this.maxSpawnDist + this.logWidth + (Math.random() * 3)) / Math.abs(this.moveSpeed));
            this.nextSpawnTimer += dt;
        }       
    }
}


var logSpawnerPool = [];

LogSpawner.prototype.setup = function(movesRight, x, y, z, forceType) {
    this.position = new THREE.Vector3(x, y, z);
    this.moveSpeed = 1.0 + (Math.random() * this.GetNewSpeed());
    this.maxSpawnDist = 1 + (Math.random() * 3);
    this.logVariation = GetRandomWorldPieceVariation("asdse");
    this.logWidth = this.logVariation.logwidth;
    this.nextSpawnTimer = Math.random() * ((0.3 + this.maxSpawnDist + this.logWidth) / this.moveSpeed);
    this.direction = movesRight ? 1 : -1;
    this.poopLane = false;
    this.logs = [];

    if (forceType == "poop-slow") {
        this.moveSpeed = 1.2 * this.moveSpeed;
        this.poopLane = true;
        this.maxSpawnDist = 2.0;
    } else if (forceType == "poop-fast") {
        this.moveSpeed = Math.max(this.moveSpeed, 2.2);
        this.poopLane = true;
        this.maxSpawnDist = 1.1;
    } else if (forceType == "poop") {
        this.poopLane = true;
    }

    // Car to log transition
    if (levelGenerator.previousLaneType == "car" || levelGenerator.previousLaneType == "asdse") {
        // Modify speed so they aren't the same, if we are the same direction and close speed.
        if (movesRight == levelGenerator.previousDirIsRight) {
            if (Math.abs(levelGenerator.previousLaneSpeed - this.moveSpeed) < 1.0) {
                if (levelGenerator.previousLaneSpeed >= 2.0) {
                    this.moveSpeed = levelGenerator.previousLaneSpeed - 1;
                } else {
                    this.moveSpeed = levelGenerator.previousLaneSpeed + 1;
                }
            }
        }
    }
    physicsObjects.push(this);

    // Forward spawn 15 seconds of logs
    this.tick(15);
    
    // Write this lane's speed
    levelGenerator.previousLaneSpeed = this.moveSpeed;
    levelGenerator.previousLaneType = "asdse";
    levelGenerator.previousDirIsRight = movesRight;
}

