function PasrTimer(pause, attack, sustain, release) {
    // The PASR timer is a class designed to count from 0 to 1 and back again.
    // P = Pause = the amount of time before the timer starts to tick.
    // A = Attack = the amount of time the timer takes to tick from 0 to 1
    // S = Sustain = the amount of time the timer holds at 1
    // R = Release = the amount of time the timer takes to tick from 1 back to 0

    // As a potential improvement I might add a "soft" reset which takes into account the current stage timer when resetting... (to ensure you don't see hard animation breaks)


    this.stage = 4; // pause=0 attack=1 sustain=2 release=3 finish=4
    this.stageTime = [4];
    this.timer;

    this.value;

    this.queriedSustain = false;
    this.queriedRelease = false;
    this.queriedFinished = true;

    this.stageTime[0] = pause;
    this.stageTime[1] = attack;
    this.stageTime[2] = sustain;
    this.stageTime[3] = release;
}

PasrTimer.prototype = {
    getPauseTime: function () { return this.stageTime[0]; },
    setPauseTime: function (value) { this.stageTime[0] = value; },
    getAttackTime: function () { return this.stageTime[1]; },
    setAttackTime: function (value) { this.stageTime[1] = value; },
    getSustainTime: function () { return this.stageTime[2]; },
    setSustainTime: function (value) { this.stageTime[2] = value; },
    getReleaseTime: function () { return this.stageTime[3]; },
    setReleaseTime: function (value) {this.stageTime[3] = value; },


    GetPauseTime: function () {
        return this.stageTime[0];
    },

    GetAttackTime: function () {
        return this.stageTime[1];
    },

    GetSustainTime: function () {
        return this.stageTime[2];
    },

    GetReleaseTime: function () {
        return this.stageTime[3];
    },

    GetDuration: function () {
        return this.stageTime[0] + this.stageTime[1] + this.stageTime[2] + this.stageTime[3];
    },

    /**
    * @jscrambler disable *
    */
    Tick: function (deltaTime) {
        if (this.stage == 4) {
            this.value = 0;
            return (0);
        }

        while (this.stage < 4 && (this.timer >= 1 || this.stageTime[this.stage] == 0)) {
            //Debug.Log ("Stage:"+stage+" completed");
            this.timer = 0;
            this.stage++;
        }


        if (this.stage < 4) {
            this.timer += deltaTime / this.stageTime[this.stage];
            if (this.timer > 1)
                this.timer = 1;
        }

        if (this.stage == 0)
            this.value = 0;
        else if (this.stage == 1)
            this.value = this.timer;
        else if (this.stage == 2)
            this.value = 1;
        else if (this.stage == 3)
            this.value = 1 - this.timer;
        else
            this.value = 0;

        //Debug.Log("Stage:"+stage+" timer:"+timer+" value:"+value);

        return this.value;
    },

    GetValue: function () {
        return this.value;
    },

    // only returns true "once"! The first time this is queried after the attack phase has completed
    reachedSustain: function () {
        if (this.queriedSustain) // player has already queried.
            return false;

        if (this.stage >= 2) {
            this.queriedSustain = true;
            return true;
        }

        return false;
    },

    reachedRelease: function () {
        if (this.queriedRelease) // player has already queried.
            return false;

        if (this.stage >= 3) {
            this.queriedRelease = true;
            return true;
        }

        return false;
    },

    isFinished: function () {
        return (this.stage == 4);
    },

    reachedFinished: function () {
        if (this.stage == 4 && !this.queriedFinished) {
            this.queriedFinished = true;
            return true;
        }
        else {
            return false;
        }
    },

    Reset: function () {
        this.stage = 0;
        this.timer = 0;
        this.value = 0;
        this.queriedSustain = false;
        this.queriedFinished = false;
    },

    Complete: function () {
        this.Reset();
        this.stage = 4; //dont replay, god this is dirty code.
    },

    Stop: function () {
        this.stage = 4;
    },

    GetStage: function () {
        return this.stage;
    },

    SetStage: function (stage) {
        this.stage = stage;
        this.timer = 0;
    },

    TotalTime: function () {
        return this.stageTime[0] + this.stageTime[1] + this.stageTime[2] + this.stageTime[3];
    },
}
var ObjectPooler = function() {
    this.items = {};
}

ObjectPooler.prototype.EnterPool = function(type, item) {
    if (this.items[type] == null) this.items[type] = [];
    if (typeof item.position != "undefined") {
        item.position.set(-60, -60, -60);
        item.visible = false;
    }

    Game.scene.remove(item);
    this.items[type].push(item);
}

ObjectPooler.prototype.PoolItemVariation = function(type, variation) {
    var item = this.GetItemVariation(type, variation, true);
    this.EnterPool(type + variation.name, item);
}

ObjectPooler.prototype.GetItemVariation = function(type, variation, forceNew) {
    if (typeof forceNew === 'undefined') forceNew = false;
    var object;
    if (this.items[type + variation.name] == null || this.items[type + variation.name].length == 0 || forceNew) {
        //console.log("do not have "+type + variation.name);
        object = importMesh('items[' + type + variation.name, variation.frames[0]);
        object.name = type + variation.name;
        object.poolName = type + variation.name; // Also set poolName because name is getting overwritten..
    } else {
        //console.log("have "+type + variation.name);
        object = this.items[type + variation.name].pop();
        object.visible = true;
    }
    Game.scene.add(object);
    object.position.set(0, 0, 0);
    object.receiveShadow = true;
    return object;
}

ObjectPooler.prototype.GetItemOfType = function(type) {
    var randomVariation = GetRandomWorldPieceVariation(type);
    var object;

    if (this.items[type + randomVariation.name] == null || this.items[type + randomVariation.name].length == 0) {
        object = importMesh('items[' + type + randomVariation.name, randomVariation.frames[0]);
        object.name = type + randomVariation.name;
        object.poolName = type + randomVariation.name; // Also set poolName because name is getting overwritten..
    } else {
        object = this.items[type + randomVariation.name].shift();
        object.visible = true;
    }
    Game.scene.add(object);
    object.position.set(0, 0, 0);

    object.receiveShadow = true;

    return object;
}

var GetRandomWorldPieceVariation = function(worldPiece) {
    if (WorldPieces[worldPiece].Variations.length == 1) {
        return WorldPieces[worldPiece].Variations[0];
    }
    //get the total weighting
    var totalWeighting = 0;
    for (var i = 0; i < WorldPieces[worldPiece].Variations.length; i++) {
        if (Game.CurrentRow >= WorldPieces[worldPiece].Variations[i].scoreRequired)
            totalWeighting += WorldPieces[worldPiece].Variations[i].weight;
    }
    //choose a radom number
    var random = Math.random() * totalWeighting;
    var currentTotal = 0;
    //check all the variations that they can be selected and add to a running total, when above random number return
    for (var i = 0; i < WorldPieces[worldPiece].Variations.length; i++) {
        //we start at negative 2, but worldpieces thing we start at 0, so need to add 2 so we don't break
        if (Game.CurrentRow + 2 >= WorldPieces[worldPiece].Variations[i].scoreRequired) {
            currentTotal += WorldPieces[worldPiece].Variations[i].weight;
            if (currentTotal >= random) {
                return WorldPieces[worldPiece].Variations[i];
            }
        }
    }

    //something went wrong??
    return WorldPieces[worldPiece].Variations[0];
}

var geos = [];

function importMesh(key, thingToImport, useUnlit, addBoundingCube) {
    if (typeof useUnlit === 'undefined') useUnlit = false;

    var geometry;
    var shader = THREE.CrossyShader;
    var uniforms = THREE.UniformsUtils.clone(shader.uniforms);

    if(geos[key]) {
        geometry = geos[key].geometry;
        vertices = geos[key].vertices;
        colours = geos[key].colours;
        material = geos[key].material;
    } else {
        var vertices = new Float32Array(thingToImport.vertices);
        var colours = new Float32Array(thingToImport.colors);

        geometry = new THREE.BufferGeometry();
        geometry.addAttribute('position', new THREE.Float32BufferAttribute(vertices, 3));
        geometry.addAttribute('color', new THREE.Float32BufferAttribute(colours, 4));
        geometry.setIndex(thingToImport.faces);
        geometry.computeVertexNormals();

        var material;
        if (useUnlit) {
            material = new THREE.MeshBasicMaterial({ vertexColors: THREE.VertexColors });
        } else {
            material = new THREE.ShaderMaterial({
                uniforms: uniforms,
                vertexColors: THREE.VertexColors,
                vertexShader: shader.vertexShader,
                fragmentShader: shader.fragmentShader,
                flatShading: true
            });
        }

        geos[key] = {
            vertices: vertices,
            colours: colours,
            geometry: geometry,
            material: material
        };
    }

    var newObject = new THREE.Mesh(geometry, material);

    if(addBoundingCube)
    {
        var min = 0,
            max = 0;
        for (var i = 2; i < vertices.length; i += 3) {
            if (vertices[i] < min) min = vertices[i];
            if (vertices[i] > max) max = vertices[i];
        }
        newObject.height = max - min;

        var min = 0,
            max = 0;
        for (var i = 0; i < vertices.length; i += 3) {
            if (vertices[i] < min) min = vertices[i];
            if (vertices[i] > max) max = vertices[i];
        }
        newObject.width = max - min;
            var min = 0,
            max = 0;
        for (var i = 1; i < vertices.length; i += 3) {
            if (vertices[i] < min) min = vertices[i];
            if (vertices[i] > max) max = vertices[i];
        }
        newObject.length = max - min;
    }

    return newObject;
}
