var isMainMenu = function() { return CrossyUI.CurrentScreen === "main" && !playing; };

var hintScaleFactor=2;
function playHint(){
    if (isMobile) {
        finger.visible = true;
    } else {
        arrowHint.width = btnWidth;
        arrowHint.visible = true;
    }

    // finger
    var position = { x: -75, y: -200 };
    var target = { x: 75, y: -200 };

    fingerTween = new TWEEN.Tween(position).to(target, 600);
    fingerTween.easing(TWEEN.Easing.Sinusoidal.In)
    fingerTween.onUpdate(function() {
        finger.x = position.x;
        finger.y = position.y;
    });
    fingerTween.onComplete(function() {
        finger.visible = false;
    });
    fingerTween.start();
    finger.x = position.x;
    finger.y = position.y;

    // line
    var right = { x: -75 };
    var rightEnd = { x: 75 };
    var lineRightTween = new TWEEN.Tween(right).to(rightEnd, 600)
        .onStart(function() {
            if (isMobile) {
                hintLine.visible = true;
            }
        })
        .easing(TWEEN.Easing.Sinusoidal.In)
        .onUpdate(function() {
            // it's reversed cause parent is width 0
            hintLine.offset.left = right.x;
        });

    lineRightTween.start();
    hintLine.offset.left = right.x;
    var left = { x: 75 };
    var leftEnd = { x: -75 };
    var lineLeftTween = new TWEEN.Tween(left).to(leftEnd, 475)
        .easing(TWEEN.Easing.Sinusoidal.In)
        .onUpdate(function() {
            // it's reversed cause parent is width 0
            hintLine.offset.right = left.x;
        })
        .delay(300);

    // buttons
    var btnWidth = 28.0 * hintScaleFactor;
    var heightToWidthRatio = 18.0 /26.0;

    // start left
    var size = { width: btnWidth };
    var arrowLeftTweenUp = new TWEEN.Tween(size)
        .to({ width: btnWidth * 1.5 }, 200)
        .easing(TWEEN.Easing.Sinusoidal.In)
        .onUpdate(function() {
            arrowHint.width = size.width;
            arrowHint.height = size.width*heightToWidthRatio;
        })
    var arrowLeftTweenDown = new TWEEN.Tween(size)
        .to({ width: btnWidth }, 200)
        .delay(200)
        .easing(TWEEN.Easing.Sinusoidal.Out)
        .onUpdate(function() {
            arrowHint.width = size.width;
            arrowHint.height = size.width*heightToWidthRatio;
        })
    arrowLeftTweenUp.chain(arrowLeftTweenDown);
    arrowLeftTweenUp.start();

    arrowHint.setAssetPath("keyboard-full.png");
    window.setTimeout(function() {
        if (isMainMenu()) {
            arrowHint.setAssetPath("keyboard-up.png");
        } else {
            arrowHint.setAssetPath("keyboard-left.png");
        }
    }, 200);

    window.setTimeout(function() {
        // finished left
        arrowHint.setAssetPath("keyboard-full.png");

        // start right
        size.width=btnWidth;
        var arrowRightTweenUp = new TWEEN.Tween(size)
            .to({ width: btnWidth * 1.5 }, 200)
            .delay(200)
            .easing(TWEEN.Easing.Sinusoidal.In)
            .onUpdate(function() {
                arrowHint.width = size.width;
                arrowHint.height = size.width*heightToWidthRatio;
            })
        var arrowRightTweenDown = new TWEEN.Tween(size)
            .to({ width: btnWidth }, 200)
            .delay(200)
            .easing(TWEEN.Easing.Sinusoidal.Out)
            .onUpdate(function() {
                arrowHint.width = size.width;
                arrowHint.height = size.width*heightToWidthRatio;
            })
        arrowRightTweenUp.chain(arrowRightTweenDown);
        arrowRightTweenUp.start();

        window.setTimeout(function() {
            if (isMainMenu()) {
                arrowHint.setAssetPath("keyboard-up.png");
            } else {
                arrowHint.setAssetPath("keyboard-right.png");
            }
             window.setTimeout(function() {
                 arrowHint.setAssetPath("keyboard-full.png");
             },300);
        }, 200+200);

    }, 500);

    lineLeftTween.onComplete(function() {
        hintLine.visible = false;
        lineLeftTween = null;
        lineRightTween = null;

        window.setTimeout(function() {
            fingerTween = null;
            if(playingHint){
                playHint();
            } else {
                size.width=btnWidth;
                var arrowGoneTween = new TWEEN.Tween(size)
                .to({ width: 0 }, 100)
                .easing(TWEEN.Easing.Sinusoidal.Out)
                .onUpdate(function() {
                    arrowHint.width = size.width;
                    arrowHint.height = size.width*heightToWidthRatio;
                })
                .onComplete(function(){arrowHint.visible=false;});
                arrowGoneTween.start();
            }
        }, 700);

    });
    lineLeftTween.start();
    hintLine.offset.right = left.x;
}

