CrossyUI.ShowPlay = function(btnDelay){
    if (CrossyUI.CurrentScreen !== "death") {
        // Only show play button on death, otherwise hide (really? :()
		//console.log("DEBUG: hiding Play Button. Current Screen:", CrossyUI.CurrentScreen);
        playButton.visible = false;
        return;
    }

    if(buttonParent.offset.bottom !== 0 && movingInUi === -1){
        buttonParent.offset.bottom = 0;
    }

    if (playButton.visible) return;

    if (typeof btnDelay === 'undefined') {
        playButton.disabled = false;
        playButton.y = 10;
    } else {
        playButton.disabled = true;
        playButton.y = -200;
        window.setTimeout(function() {
            playButton.y = 10;
            playButton.disabled = false;
        }, btnDelay);
    }

	//console.log("DEBUG: showing Play Button. Current Screen:", CrossyUI.CurrentScreen);
    playButton.visible = true;
}

CrossyUI.HidePlay = function(){
    if (!playButton.visible) return;

    playButton.visible = false;
    canGo = false;
}

var gamePaused = false;

var unpauseTimer;
CrossyUI.TogglePause = function(){
    if (!gamePaused) {
        CrossyUI.Pause();
    } else {
        CrossyUI.unPause();
        // will toggle when timer is done
    }
}

CrossyUI.Pause = function() {
    clock.stop();
	//console.log("Stopping clock...we are now paused!");

    requestAnimationFrame(function() {
        // Don't show pause overlay until next frame to prevent it's click handler being called right away
        if (!gamePaused) return; // Unless we unpaused in the meantime

        pauseOverlay.style.display = 'block';
        pauseIndicator.style.display = 'block';
        pauseCounter.style.display = 'none';
        pauseBtn.visible = false;

        CrossyUI.updatePauseUI();
    });

    unpauseTimer = -1;

    // toggle
    gamePaused = true;
    Game.audioManager.SetVolume(0);
}

var unpauseInterval;
CrossyUI.unPause = function() {
	//console.log("CrossyUI.unPause()");
    if (unpauseTimer > 0 || RewardedHelper.adPlaying) return;

    if (!Game.playerController.Dead && playing) {
        unpauseTimer = 3;

        // Our clock doesn't run when paused, so set an interval to handle the timer
        clearInterval(unpauseInterval);
        unpauseInterval = window.setInterval(function() {
            unpauseTimer--;
            if (unpauseTimer < 0) {
                clearInterval(unpauseInterval);
            }
        }, 1000);
    } else{
        // no timer for unpausing outside of playing
        unpauseTimer = 0.01;
    }
}

CrossyUI.UpdatePause = function() {
    if (unpauseTimer >= 0) {
        pauseCounter.style.display = 'block';
        pauseIndicator.style.display = 'none';
        pauseBtn.visible = false;

        if(unpauseTimer > 2){
            pauseCounter.innerText = '3';
        } else if(unpauseTimer > 1){
            pauseCounter.innerText = '2';
        } else if(unpauseTimer > 0.01){
            pauseCounter.innerText = '1';
        } else {
            // We are now actually unpaused
            clock.start();
			//console.log("now unpaused, starting clock");

            pauseCounter.innerText='';
            pauseCounter.style.display = 'none';
            // toggle
            gamePaused = false;
            pauseOverlay.style.display = 'none';

            if (playing && !Game.playerController.Dead) {
                pauseBtn.visible = true;
            }
			
			// this doesn't seem to be firing on unPause
			//
            // renable sounds if needed
            if (isSound) {
				doUnmute();
				//Game.audioManager.SetVolume(.8);
				//console.log("Setting sound on...after pause");				
            }
        }
    }
}

CrossyUI.tutorialLock = false;
CrossyUI.lockForTutorial = function() {
    this.tutorialLock = true;
}

CrossyUI.removeTutorialLock = function() {
    if(!this.tutorialLock) return;

    this.unfadeFromBlueTween.start();

    this.ShowPlay(200);
}

CrossyUI.deathUIShown = false;
CrossyUI.handleDeathUI = function () {
	
	//console.log("&&&&&&&& in handleDeathUI - deathUIShown:",this.deathUIShown);
	
    if (this.deathUIShown) {
		//console.log("&&&&&&&& returning....");
		return;
	}
	
	this.deathUIShown = true;
	//console.log("------- setting to TRUE - deathUIShown:",this.deathUIShown);
    

	//console.log("tutlock:",this.tutorialLock);
    if (this.tutorialLock) {
		
		//console.log("call fadeToBlue Tween");
        this.fadeToBlueTween.start();
	
		//console.log("call firstNotifBar()");
        CrossyUI.focusFirstNotificationBar();
        return;
    }

    // Play button logic

    var btnDelay = 500;
    var tutorialLock = false;
    for (var idx = 0;idx < activeNotificationBars.length;idx++) {
        var bar = activeNotificationBars[idx];

        if (bar.shakeMe || bar.type === 'upsell-notification') {
            // Delay the play button longer if something is shaking, or if it's an upsell notification / modal
            btnDelay = Math.max(2000, btnDelay);
        } else {
            btnDelay = Math.max(500 + 500 * activeNotificationBars.length, btnDelay);
        }
    }

    if (AppStoreInterstitial.isVisible()) {
        btnDelay = Math.max(2000, btnDelay);
    }

	//console.log("handleDeathUI - Button Delay:", btnDelay);
	
    CrossyUI.ShowPlay(btnDelay);
	
	// **Force Show Play Button Immediately** (bypass notification delays)
    //CrossyUI.ShowPlay(0); // Immediately show the play button

    CrossyUI.focusFirstNotificationBar();
};

CrossyUI.focusFirstNotificationBar = function() {
	
	//console.log("inside focusFirstNotifBar()");
	
    var setFocusOn = playButton._visible ? playButton : null;
    for (var idx = 0;idx < activeNotificationBars.length;idx++) {
        var bar = activeNotificationBars[idx];

        if (bar.button._visible) {
            setFocusOn = bar.button;
            break;
        }
    }

	//console.log("focusFirstNotif: setFocusOn:",setFocusOn);
    if (setFocusOn) {
        KeyboardUIControls.setFocus(setFocusOn);
    }
	
	// JAB
	// Force focus on the play button if visible
	//console.log("focusFirstNotif: playbutton vis:",playButton._visible);
    if (playButton._visible) {
        KeyboardUIControls.setFocus(playButton);
        //console.log("Focus forced on Play Button.");
    }
	
}

var timeSinceLastTapBlink = 0;
CrossyUI.UpdateUI = function(deltaTime) {
    if (CrossyUI.CurrentScreen === 'death') {
        if (!Game.playerController.waitingForEagle) {
            if (Game.playerController.eagleCountdown > 0) {
                Game.playerController.eagleCountdown -= deltaTime;
            } else {
                this.handleDeathUI();
            }
        }
    } else {
        CrossyUI.deathUIShown = false;
    }

    //coinText.setText(GameSave.GetCoins());  //will need modifying
	
	//no need to pull, the gets called too much to be hitting the cloud so much
	//
	coinText.setText(Game.coins); 
    
	//if (Game.score > 0) {
    //    scoreText.setText(Math.round(Game.score));
	//
    //    var ts = 0;
    //    if ((ts = crossyStorage.getItem('crossyScore')) != null) {
    //        if (ts > 0) {
    //            topScore.setText("TOP " + Math.round(ts).toString());
    //        } else {
    //            topScore.setText("");
    //        }
    //    }
    //} else {
    //    scoreText.setText("");
    //    topScore.setText("");
    //}
	
	if (Game.score > 0) {
		// Update score text
		scoreText.setText(Math.round(Game.score));
	} else {
		// If score is 0, reset score and top score text
		scoreText.setText("");
		topScore.setText("");
	}

    // Tap blink things
    var timeForTapBlink;
    if (moveToPlay.assetPath === 'tap1.png' || moveToPlay.assetPath === 'keyboard-full.png') {
        // Blank frame of tap animation lasts longer
        timeForTapBlink = 0.333;
    } else {
        timeForTapBlink = 0.25;
    }

    if (timeSinceLastTapBlink >= timeForTapBlink) {
        if (moveToPlay.assetPath === 'tap1.png') { // should actually be tap1 for 333ms
            moveToPlay.setAssetPath('tap2.png');
            moveToPlay.y = 26;
        } else if (moveToPlay.assetPath === 'tap2.png') { // should actually be tap2 for 250ms
            moveToPlay.setAssetPath('tap1.png');
            moveToPlay.y = 20;
        }

        // Nope
        // } else if (moveToPlay.assetPath === 'keyboard-full.png') {
        //     moveToPlay.setAssetPath('keyboard-up.png');
        // } else if (moveToPlay.assetPath === 'keyboard-up.png') {
        //     moveToPlay.setAssetPath('keyboard-full.png');
        // }

        timeSinceLastTapBlink = 0;
    } else {
        timeSinceLastTapBlink += deltaTime;
    }

    // Only clear top of screen during gameplay for UI
    if (CrossyUI.CurrentScreen === 'main' && playing && !finger.visible && !arrowHint.visible && !hintLine.visible) {
        Game.UI.clearRect = {
            x: 0,
            y: 0,
            width: Game.UI.width,
            height: 100,
        };
    } else {
        Game.UI.clearRect = null;
    }

    for(var idx = 0;idx < activeNotificationBars.length;idx++) {
        var bar = activeNotificationBars[idx];

        if (bar.shakeMe) {
            var timer = Game.frameCount / 30;
            var shakeAmount = Math.abs(Math.max(-1, Math.sin(timer) * 2));
            bar.background.y = bar.background.startY + CrossyUtils.getRandomArbitrary(-shakeAmount, shakeAmount);
        } else {
            bar.background.y = bar.background.startY;
        }
    }
}

function CreateUI() {
    Game.UI = new ThreeUI(Game.canvas, 720, Game.renderUIOnQuad);
    // Pixels
    if (Game.renderUIOnQuad) {
        Game.UI.texture.minFilter = THREE.NearestFilter;
        Game.UI.texture.magFilter = THREE.NearestFilter;
    } else {
        Game.UI.canvas.className = 'pixelated'; // Image rendering set to pixelated through style.css
    }
}

CrossyUI.calcButtonsWidth = function() {
    return characterSelect.width + (characterSelect.x * 2) + playButton.width + (showMore.x * 2) + showMore.width;
}

var UIButtonScale=1.0;
CrossyUI.ButtonScaleSet = function(){
    if(!playButton) return;

    var moveToPlayRatio = isMobile ? (13 / 19) : (26 / 18);

    // Scale down until they don't overlap
    var newScale = 1;
    do {
        characterSelect.width = 130 * newScale;
        characterSelect.height = 84 * newScale;
        showMore.width = 130 * newScale;
        showMore.height = 84 * newScale;
        playButton.width = 158 * newScale;
        playButton.height = 84 * newScale;
        mute.width = 130 * newScale;
        mute.height = 84 * newScale;
        mute.y = showMore.y + showMore.height + 10;
        showUpsell.width = 130 * newScale;
        showUpsell.height = 84 * newScale;
        showUpsell.y = mute.y + mute.height + 10;

        moveToPlay.height = 80 * newScale;
        moveToPlay.width = moveToPlay.height * moveToPlayRatio;

        moveToPlayHitzone2.offset.bottom = playButton.height + playButton.y;
        moveToPlayHitzone1.offset.left = characterSelect.x + characterSelect.width;
        moveToPlayHitzone1.offset.right = showMore.x + showMore.width;
        moveToPlayHitzone1.height = playButton.height + playButton.y;

        newScale -= 0.05;
    } while (CrossyUI.calcButtonsWidth() > Game.UI.width);
}

