var coinSize = 30;
var removeCoin = function(coin) {
	var coords = { w: coinSize, coin: coin };
	new TWEEN.Tween(coords)
		.to({ w: 0 }, 150)
		.easing(TWEEN.Easing.Sinusoidal.InOut)
		.onUpdate(function() {
			this.coin.width = this.w;
			//this.coin.height = this.h;
		})
		.onComplete(function(){
            Game.UI.delete(this.coin);
		})
		.onStart(function(){
			this.coin.setAssetPath('coin-white.png');
		})
		.start();
}

var getDistance = function(x1, y1, x2, y2) {
    var a = x1 - x2;
    var b = y1 - y2;

    return Math.sqrt(a * a + b * b);
}

CrossyUI.coinBlast = function(amount) {
    if (this.coins && this.coins.length > 0) {
        this.coins.forEach(function(coin) {
            Game.UI.delete(coin);
        }.bind(this));
    }

    window.setTimeout(function() {
        Game.playSfx('gift/emptying_the_piggy_bank_2');
    }, 100);

    this.coins = [];

	var maxDistance = getDistance(0, 0, Game.UI.width, Game.UI.height);

    for(var idx = 0;idx < amount;idx++){
        var startX = CrossyUtils.getRandomInt(0, Game.UI.width);
        var destX = CrossyUtils.getRandomInt(0, Game.UI.width);

        var startY = -coinSize;
        var destY = CrossyUtils.getRandomInt(0, Game.UI.height);

        var coinIcon = Game.UI.createSpriteFromSheet('coin-basic.png', 'sprites/CrossyUI.png', 'sprites/CrossyUI.json');
        coinIcon.smoothing = false;
        coinIcon.anchor.x = ThreeUI.anchors.left;
        coinIcon.anchor.y = ThreeUI.anchors.top;
        coinIcon.x = startX;
        coinIcon.y = startY;

        this.coins.push(coinIcon);

        // Make sure coin velocities are the same, not their tween time!
        // var distanceToTravel = getDistance(startX, startY, destX, destY);
        // var normalizedDistance = CrossyUtils.normalize(distanceToTravel, 0, maxDistance);
        // var timeToMaxDistance = 750;
        // var tweenTime = timeToMaxDistance * normalizedDistance;

        var coords = { x: startX, y:startY, w: coinSize * .001, coin: coinIcon, idx: idx };
        var delay = Math.random() * 200;
        // Move tween
        new TWEEN.Tween(coords)
            .to({ x: destX, y:destY, w:coinSize }, 400)
            .easing(TWEEN.Easing.Quartic.Out)
            .onUpdate(function() {
                this.coin.width = this.w;
                this.coin.height = this.w;

                this.coin.x = this.x;
                this.coin.y = this.y;
            })
            .delay(delay)
            .onComplete(function(){
                window.setTimeout(function() {
                    if (Game.UI.displayObjects.indexOf(this.coin) > -1) {
                        if (this.idx % 5 === 0) {
                            Game.playSfx('Get Coin 79 wav', true);
                        }
                    }
                    removeCoin(this.coin);
                }.bind(this), 200 + this.idx * 30);
            })
            .start();

        // Rotate tween
        new TWEEN.Tween(coinIcon)
            .to({ rotation: CrossyUtils.getRandomInt(-180,180) }, 600)
            .easing(TWEEN.Easing.Cubic.Out)
            .delay(delay)
            .start();
    }
}

CrossyUI.hideRemainingCoins = function() {
    if (this.coins && this.coins.length > 0) {
        this.coins.forEach(function(coin) {
            Game.UI.delete(coin);
        }.bind(this));
    }
}

var movingInUi=-1;
var uiMoveTween=null;
CrossyUI.moveInUI = function(timeOut) {
    if(movingInUi >- 1 ){
        var dt = (Date.now() - movingInUi) / (timeOut || 1000);
        window.setTimeout(function(){
            if(uiMoveTween._isPlaying != true){
                if(buttonParent.offset.bottom !== 0){
                    movingInUi =- 1;
                    CrossyUI.moveInUI();
                }
            }
        }, timeOut || 1000);
        return;
    }

    movingInUi=Date.now();
    buttonParent.offset.bottom = -180;
    var coords={y:buttonParent.offset.bottom};
    uiMoveTween = new TWEEN.Tween(coords)
        .to({ y: 0 }, 150)
        .onUpdate(function(){
            buttonParent.offset.bottom=this.y;
            Game.UI.shouldReDraw = true;
        })
        .delay(1000)
        .onStart(function(){
            //console.log((Date.now()/1000)+" moving in UI!");
            uiMoveTween._isPlaying=true;
        })
        .onComplete(function(){
            movingInUi=-1;
            uiMoveTween._isPlaying=false;
        })
        .start();
}
