var getNotificationBarContentDimensions = function() {
    var aspectRatio = Game.canvas.width / Game.canvas.height;
    var percLandscape = CrossyUtils.inverseLerp(window.minAspect, window.maxAspect, aspectRatio);

    // Note: maybe do this in steps to prevent ugly buttons

    return {
        width: THREE.Math.lerp(notificationBarPortraitWidth, notificationBarLandscapeWidth, percLandscape),
        height: THREE.Math.lerp(notificationBarPortraitHeight, notificationBarLandscapeHeight, percLandscape)
    };
};

