Carousel.prepareCharacters = function(){
	console.log("Preparing Carousel characters...");
	
	
    Carousel.characters=[];
	
	//JAB check to see if defined!
	//
	if (!Game.characters || Object.keys(Game.characters).length === 0) {
		console.log("No characters found or not defined");
	}
	
	//console.log("Prep: Game.characters:", Game.characters);
	
    for (var char in Game.characters) {
        if (Game.characters.hasOwnProperty(char)) {
            Carousel.characters.push(Game.characters[char].mesh);
            Game.characters[char].mesh.charName = char;
            //Game.characters[char].mesh.fullName = CrossyLocalisation.GetString(char);
			Game.characters[char].mesh.fullName = CrossyLocalisation.GetString(char) || "UNKNOWN";
        }
    }
}

Carousel.hasEnoughCoinsForCharacter = function() {
    //return GameSave.GetCoins() >= Carousel.charactCost;
	return Game.coins >= Carousel.charactCost;
};

Carousel.HowManyUnlocked=function(){
    var unlocked = {
        number: 0,
        all: true,
    };

    var index = 0;
    Object.keys(Game.characters).forEach(function(key) {
        var data = Game.characters[key];
        if (key === 'chicken' || GameSave.GetCharacter(index)) {
            unlocked.number++;
        } else if (!data.locked) {
            unlocked.all = false;
        }
        index++;
    });

    return unlocked;
}

// Get candidates for random unlocking
Carousel.GetRandomCharacterCandidates = function () {
    var candidates = [];

    Object.keys(Game.characters).forEach(function(key, idx) {
        var character = Game.characters[key];
        if (character.locked) return;
        if (idx === 0 || GameSave.GetCharacter(idx)) return;

        candidates.push({ char: character, idx: idx });
    });

    return candidates;
}

Carousel.UnlockRandomCharacter = function(){
    var candidates = Carousel.GetRandomCharacterCandidates();
    var toUnlock = CrossyUtils.getRandomFromArray(candidates);

    GameSave.ModifyCoins(-Carousel.charactCost);
    GameSave.UnlockCharacter(toUnlock.idx);

    Carousel.roundsSinceBuyingCharacter = 0;

    return toUnlock;
}

