Carousel.Update = function(deltaTime) {
    for (var itr = 0; itr < Carousel.characterModels.length; itr++) {
        var model = Carousel.characterModels[itr];
        var newScale;

        if (itr == Carousel.focus) {
            newScale = THREE.Math.lerp(model.scale.x, 2.2, deltaTime * 5);
        } else {
            newScale = THREE.Math.lerp(model.scale.x, 1, deltaTime * 5);
        }

        model.scale.set(newScale, newScale, newScale);

        if (GameSave.GetCharacter(itr) ){
            model.rotation.set(0, model.rotation.y - 1.0 * deltaTime, 0);
        } else {
            model.rotation.y = startRotation;
        }
    }
}

Carousel.processClick = function(event) {
    if (CrossyUI.CurrentScreen !== 'selectingCharacter') return;

    var bounds = Game.containerRect;

    // Send a raycast from the mouse, if it hits a character, navigate to it

    var mouse = new THREE.Vector2();

    mouse.x = (((event.clientX - bounds.left) / bounds.width) * 2) - 1;
    mouse.y = (-((event.clientY - bounds.top) / bounds.height) * 2) + 1;

    this.raycaster.setFromCamera(mouse, Game.camera);
    var intersects = this.raycaster.intersectObjects(Game.scene.children);

    var foundMesh = null;
    intersects.forEach(function(intersected) {
        if (foundMesh) return;

        Carousel.characterModels.forEach(function(model, index) {
            if (foundMesh) return;

            if (model === intersected.object) {
                foundMesh = index;
            }
        });
    });

    if (foundMesh === null) return;

    var navigate = foundMesh - this.focus;
    if (navigate !== 0) {
        this.Navigate(navigate);
    }
};

var previousFocus;
Carousel.ProcessTouchStart = function() {
    previousFocus = Carousel.focus;
}
var carouselCamTween;

var TweenCarouselCam = function() {
    if (Carousel.focus * 2 === Game.camera.position.x) return;

    // tween camera.position.x to Carousel.focus * 2;
    if (carouselCamTween) carouselCamTween.stop();

    var dt = 100 * Math.abs(Carousel.focus * 2 - Game.camera.position.x);
    carouselCamTween = new TWEEN.Tween(Game.camera.position)
        .easing(TWEEN.Easing.Sinusoidal.InOut)
        .to({ x: Carousel.focus * 2 }, dt)
        .start();
}

var targetScrollSpeed = 0.01;

Carousel.ProcessTouchMove = function(dx) {
    AppStoreInterstitial.hide();

    var minX = 0;
    var maxX = Carousel.characters.length * 2 - 1;
    var buffer = 0.5;
    var scrollSpeed = targetScrollSpeed;

    if (Game.camera.position.x < minX && Game.camera.position.x > minX - buffer) {
        scrollSpeed *= 0.5;
    } else if (Game.camera.position.x > maxX && Game.camera.position.x < maxX + buffer) {
        scrollSpeed *= 0.5;
    }

    Game.camera.position.x += dx * scrollSpeed * -1;
    Game.camera.position.x = THREE.Math.clamp(Game.camera.position.x, minX - buffer, maxX + buffer);

    var previousFocus = Carousel.focus;
    Carousel.focus = Math.round(
        THREE.Math.clamp(Game.camera.position.x, minX, maxX - 2) / 2
    );

    if (previousFocus !== Carousel.focus) {
        Carousel.CheckAvailability(); // Ensure this is safe
    }

    if (Carousel.text) {
        Carousel.text.text = Carousel.characters[Carousel.focus]?.fullName?.toUpperCase() || 'UNKNOWN';
        Carousel.text.color = GameSave.GetCharacter(Carousel.focus) ? '#ffffff' : '#dddddd';
    }
}

