Carousel.ProcessTouchEnd = function() {
    TweenCarouselCam(Carousel.focus);
}

//gives us the relative movement and we tween the camera towards the next character
Carousel.Navigate = function(dx) {
    // Adjust focus
    Carousel.focus = Math.min(Carousel.characterModels.length - 1, Math.max(0, Carousel.focus + dx));

    Carousel.text.text = Carousel.characters[Carousel.focus].fullName.toUpperCase();

    if (!GameSave.GetCharacter(Carousel.focus)) {
        Carousel.text.color = '#dddddd';
    } else {
        Carousel.text.color = '#ffffff';
    }

    //CrossyUI.GetActiveButton();//make us show the reticle
    Carousel.CheckAvailability();
    TweenCarouselCam(Carousel.focus);
    AppStoreInterstitial.hide();
}

