function PopulatePools() 
{
    Object.keys(WorldPieces).forEach(function(type) {
        var piece = WorldPieces[type];
        piece.Variations.forEach(function(variation) {
            var amount = piece.poolAmount || 0;
            for (var i = 0; i < amount;i++) {
                objectPooler.PoolItemVariation(type, variation);
            }
        });
    });

    // Rapids particles
    var particles = [];
    for(var i = 0;i < 30;i++) {
        var particle = RapidsParticle.getRapidsParticle(60, 60, 60, 0);
        particles.push(particle);
    }

    particles.forEach(function(particle) {
        particle.pool();
    });

    // Objects
    // Car.PopulatePool(70);
    // CarSpawner.PopulatePool(15);
    Strip.PopulatePool(30);
    // TrainWarning.PopulatePool(10);
    // TrainSpawner.PopulatePool(10);
    // Train.PopulatePool(10);
    // Log.PopulatePool(70);
    // LogSpawner.PopulatePool(15);
    // Lillypad.PopulatePool(15);

    // Train lights
    var trainLights = [];
    for (var i = 0;i < 10;i++) {
        var light = TrainWarning.Get(-10, -10, -10);
        trainLights.push(light);
        light.pool();
    }
}

Game.wipeAndRestart = function(callbackDuringInterstitial) {
    Game.takesUserInput = false;

    CrossyUI.showInterstitial(function(){
        CrossyUI.hideRemainingCoins();

        freeNotificationBars();

        if (typeof callbackDuringInterstitial === 'function') {
            callbackDuringInterstitial();
        }

        RewardedHelper.newRoundStarted(); // JAB leave this in??
        // Do all below once interstitial is shown
        CharacterTryouts.setCharacterIfTryingOut();
        Game.playerController.Reset();

        Game.CurrentRow = 0;
        Game.score = 0;
        currentTerrain = -8;
        while (rows.length > 0) {
            var rowToPool = rows.pop();
            rowToPool.PoolAllObjects();
            rowToPool = null;
        }
        while (physicsObjects.length > 0) {
            physicsObjects.pop().pool();
        }
        playing = false;
        timeSinceDeath = 0;
        eagle.reset();
        levelGenerator.Restart();
        AddTerrain();

        CrossyUI.showMain();

        configureCameras();
        CrossyUI.moveInUI();

        Game.takesUserInput = true;
        topScore.visible = false;
    });
}

function AddTerrain() {
    var rowsToGenerate=18;
    while (Game.CurrentRow + rowsToGenerate+1 > currentTerrain) {
        var newRow = levelGenerator.GetStrip(currentTerrain);
        newRow.lane.position.set(0, 0, -currentTerrain);
        rows.push(newRow);
        newRow.MatrixUpdate();
        currentTerrain++;
    }

    while (rows[0].lane.position.z * -1 < Game.CurrentRow - 10) {
        var rowToPool = rows.shift();
        rowToPool.PoolAllObjects();
        rowToPool = null;
    }
}

var timeToCarSound = 0.0;
var timeToCarHorn = 6.0;
var timeToRandomCharSound=6.0;

function randomSounds(delta) {
    if (CrossyUI.CurrentScreen !== 'main' && CrossyUI.CurrentScreen !== 'death') return;

    timeToCarSound -= delta;
    timeToCarHorn -= delta;

    if (timeToCarSound <= 0.0) {
        playRandomSfx(['car1', 'car2', 'car3']);
        timeToCarSound = 1 + 2 * Math.random();
    }

    if (timeToCarHorn <= 0.0) {
        Game.playSfx('car-horn');
        timeToCarHorn = 3 + 6 * Math.random();
    }

    if(typeof Game.playerController.currentCharacter.random !== 'undefined' && !Game.playerController.Dead && playing){
        timeToRandomCharSound -= delta;
        if (timeToRandomCharSound <= 0.0) {
            playRandomSfx(Game.playerController.currentCharacter.random);
            timeToRandomCharSound = 3 + 3 * Math.random();
        }
    }
}

function animate() {
    Game.frameCount++;

    deltaTime = Math.min(clock.getDelta(), 0.5); // Whatever happens, don't allow deltaTime to be higher than 0.5
	
	// Add Check deltaTime is valid - JAB
    if (!isFinite(deltaTime)) {
        console.error("Non-finite deltaTime detected:", deltaTime);
        deltaTime = 0; // Reset if necessary
    }

    TWEEN.update();

    update();
    render();

    if (gamePaused) {
        CrossyUI.UpdatePause();
    } else {
        CrossyUI.UpdateUI(deltaTime);
    }

    if (stats) stats.update();

    requestAnimationFrame(animate);
}
/**
* @jscrambler define selfDefending {threshold: 1} as sd1
* @jscrambler enable sd1
*/

function update() {
	//console.log("CrossyUI.CurrentScreen:", CrossyUI.CurrentScreen );
    Game.UI.disableInput = (gamePaused || !Game.takesUserInput);

    if (!gameReady || gamePaused || document.readyState === 'loading')
        return;

    updateGameCamera();

    updateScore();

    randomSounds(deltaTime);

    tickPhysics(deltaTime);

    Game.playerController.Update(deltaTime);

    if (playing && !Game.playerController.Dead) {
        fpsTracker.update(deltaTime);
    }

    switch (CrossyUI.CurrentScreen) {
        case 'selectingCharacter':
            Carousel.Update(deltaTime);
            break;

        case 'gumball':
            GumballMachineScreen.update(deltaTime);
            break;

        case 'free-gift':
            FreeGiftScreen.update(deltaTime);
            break;
    }

    KeyboardUIControls.update(deltaTime);
}

