function tickPhysics(delta) 
{
    //goes through array of physics objects and calls tick()
    for (var physi = 0; physi < physicsObjects.length; physi++) {
        physicsObjects[physi].tick(delta);
    }

    if (playing) {
        if (!levelGenerator.isTutorial || eagle.swooping) {
            eagle.tick(deltaTime);
        } else if (Game.playerController.player.position.z + 3.6 > Game.camera.position.z) {
            // Still kill the player in the tutorial if he's leaving the screen
            eagle.kill();
        }
    }
}

