// Ensure a single instance globally, avoiding redeclaration errors
window.StartInitLoader = window.StartInitLoader || (function() {
    const loader = {
        queue: [],
        
        add(task) {
            this.queue.push(task);
        },
        
        load() {
            return Promise.all(this.queue.map(task => task()))
                .then(() => {
                    console.log("All initialization tasks completed.");
                })
                .catch(error => {
                    console.error("Error in initialization tasks:", error);
                });
        }
    };
    return loader;
})();


