/////////////////////////////////
function sendScoreToYouTube(score) {
    var integerScore = Math.floor(score);  // Ensure score is an integer
    
    if (typeof ytgame !== 'undefined' && typeof ytgame.engagement !== 'undefined') {
        ytgame.engagement.sendScore({ value: integerScore })
            .then(function() {
                console.log("Score submitted successfully.");
            })
            .catch(function(error) {
                console.error("Failed to submit score:", error);
            });
    } else {
        console.error("YouTube Playables SDK or engagement API is not available.");
    }
}

function gameOver(finalScore) 
{
    console.log("Game Over. Final Score:", finalScore);
    
    // Send score to YTP SDK
    sendScoreToYouTube(finalScore);
}

